      height: 100%;           
      }
      
      .SvgOverlay svg {
      position: absolute;
      top: -4000px;
      left: -4000px;
      width: 8000px;
      height: 8000px;        
      }
      
      .SvgOverlay path {
      fill: blue;
      fill-opacity: .3;
      }
      
    </style>
  </head>
  <body>
    
    <div id="map"></div>

    <script>
      
      var paths;
      var svg;
      $(function () {
      
      // Add the map
      var $map = $("#map");
      var map = new google.maps.Map($map[0], {
      zoom: 14,
      mapTypeId: google.maps.MapTypeId.ROADMAP,
      center: new google.maps.LatLng(51.802352, 5.353260),
      styles:[{"stylers": [{"saturation": -75},{"lightness": 25}]}]           
      });
      
      // Load data
      var geoJson = grid;
      var overlay = new google.maps.OverlayView();

      // Add the svg element
      overlay.onAdd = function () {

      var layer = d3.select(this.getPanes().overlayLayer).append("div").attr("class", "SvgOverlay");
      svg = layer.append("svg").attr('class', 'svgmap');
      
      };


      overlay.draw = function () {
      svg.selectAll('.cells').remove()
      var cells = svg.append("g").attr("class", "cells");
      var markerOverlay = this;
      var overlayProjection = markerOverlay.getProjection();

      // Turn the overlay projection into a d3 projection
      var googleMapProjection = function (coordinates) {
      var googleCoordinates = new google.maps.LatLng(coordinates[1], coordinates[0]);
      var pixelCoordinates = overlayProjection.fromLatLngToDivPixel(googleCoordinates);
      return [pixelCoordinates.x + 4000, pixelCoordinates.y + 4000];
      }
      path = d3.geo.path().projection(googleMapProjection);
      paths = cells.selectAll("path")
      .data(geoJson.features)
      .attr("d", path) // update existing paths
      .enter().append("svg:path")
      .attr("d", path)
      .attr("id", function(x,i) {return 'cell' + x.properties.cellid});
      };

      overlay.setMap(map);
      
      }

      );
      
    </script>
    <script>
      function opacity() {
      paths
      .transition()
      .duration(1000)
      .style('fill', function(x){return d3.hsl(360*x.properties.cellid/1350,0.5,0.3).toString()});
      
      }
      function opacity2() {
      paths
      .transition()
      .duration(1000)
      .style('opacity', 0.2)
      .transition()
      .duration(1000)
      .style('opacity', function(x){return Math.random();})
      .transition()
      .duration(1000)
      .style('opacity', function(x){return Math.random();})
      .transition()
      .duration(1000)
      .style('opacity', function(x){return Math.random();})
      .transition()
      .duration(1000)
      .style('opacity', function(x){return Math.random();})
      .transition()
      .duration(2000)
      .style('opacity', 0.9)
      }
    </script>
  </body>
</html>
